import React from 'react';

export default function Chart(props) {

  let element = props.categoryData.map((item, index) => {
    return (
      <div className='chart' key={index}>

        <p>Category: {item.category}</p>
        <p>Count: {item.satcount}</p>
      </div>
    );
  });

  return <div className='chart'>{element}</div>;
}
